import React from 'react';
import "./style.css"
import {HorizontalBar} from 'react-chartjs-2';
import { Container, Row } from 'react-bootstrap';

export default function Skills() {

    const state = {
        labels: 
            ['HTML5', 'CSS3', 'JavaScript',
                 'jQuery', 'ReactJS', 'NodeJS', 
                 'AJAX', 'MySQL', 'MongoDB', 'ExpressJS'],
        datasets: [
          {
            label: 'Languages',
            backgroundColor: 'rgba(39,39,131,1)',
            borderColor: 'rgba(0,0,0,1)',
            borderWidth: 0.5,
            data: [90, 85, 80, 80, 75, 70, 90, 70, 70, 80],
            hoverBackgroundColor: "rgb(255, 234, 118)"
          },
        ]
    }

    return (
        <div className="skills-section">
            <Container className="d-flex justify-content-center">
                <Row>
                <h1>SKILLS</h1>
                        <div className="col-md-12 flex">

                            <div className="skills-chart">
                                <HorizontalBar
                                    data={state}
                                    options={{
                                        title:{
                                            display:true,
                                            fontSize:40,
                                            message: "Languages"
                                        },
                                            legend:{
                                            display:false,
                                            position:'top'
                                        }
                                    }}
                                />
                            </div>
                        </div>
                </Row>
            </Container>
            <Container className="d-flex justify-content-center">
                <Row>
                <h1></h1>
                        <div className="col-md-12 flex">

                            <div className="skills-chart">
                                <HorizontalBar
                                    data={state}
                                    options={{
                                        title:{
                                            display:true,
                                            fontSize:40,
                                            message: "Languages"
                                        },
                                            legend:{
                                            display:false,
                                            position:'top'
                                        }
                                    }}
                                />
                            </div>
                        </div>
                </Row>
            </Container>
        </div>
    );
}
